import React from 'react'
import HomeStyle from './Home.module.css'
import clothing from "./Images/clothing.png"
import womenclothing from "./Images/womenclothing.png"
import electronics from "./Images/electronics.png"
import jewelery from "./Images/jewelery.png"
import { Link } from 'react-router-dom'


class Home extends React.Component {

    constructor() {
        super()

        this.state = {
          products: []
        }
      }

    render() {
        //console.log('prod',this.props.products)
        return (

            <div className={HomeStyle.container} key={"home"}>
                <div className={HomeStyle.menclothing}>
                    <img to="/menclothing" className={HomeStyle.image1} src={clothing} alt="Clothing" />
                    <Link to="/menclothing">Men's Clothing</Link>
                </div>

                <div className={HomeStyle.womenclothing}>
                    <img to='/womenclothing' className={HomeStyle.image11} src={womenclothing} alt="Clothing" />
                    <Link to='/womenclothing'>Women's Clothing</Link>
                </div>

                <div className={HomeStyle.electronics}>
                    <img to="/electronics" className={HomeStyle.image2} src={electronics} alt="Electronics" />
                    <Link to="/electronics">Electronics</Link>
                </div>

                <div className={HomeStyle.jewelery}>
                    <img to="/jewelery" className={HomeStyle.image3} src={jewelery} alt="Jewelery" />
                    <Link to="/jewelery">Jewelery</Link>
                </div>
